import React, { Component } from 'react';
import logo from './logo.svg';
import './team08.css';

class App extends Component {
  render() {
    return (
      <div className="App">
      <BrowserRouter>
          <Router />
        </BrowserRouter>
      </div>
    );
  }
}

export default App;
